// fe/src/components/Header.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css'; // Assuming you have some basic styles for the header

const Header = () => {
    return (
        <header className="header">
            <nav>
                <ul>
                    <li><Link to="/">Home</Link></li>
                    <li><Link to="/about">About</Link></li>
                    <li><Link to="/contact">Contact</Link></li>
                    <li>
                        <div className="dropdown">
                            <button className="dropbtn">Register</button>
                            <div className="dropdown-content">
                                <Link to="/register/normal">Register as Normal User</Link>
                                <Link to="/register/business">Register as Business User</Link>
                            </div>
                        </div>
                    </li>
                </ul>
            </nav>
        </header>
    );
};

export default Header;
